    "steam_appid": 242800,
    "detailed_description": "<img src=\"http://cdn.steamstatic.com.8686c.com/steam/apps/242800/extras/ConcoursSurvivalSteam3 copie.jpg?t=1447358089\"><br><br>New Free DLC<br><br>SURVIVAL - CRAFTING - ADVENTURE<br><br>Explore a vast hostile environment while crafting new tools to help you survive. Discover intriguing puzzles and the mystery behind the strange remains of artifacts left in the Amazon Jungle.<br><strong><br>Key Features : </strong><br><br><ul class=\"bb_ul\"><li>Start with nothing and craft, hunt, fish and fight to survive. <br></li><li>Hunt panthers for their meat <br></li><li>Catch fish and find fruits <br></li><li>Build fire and cook your food <br></li><li>Search for water sources <br></li><li>Sneak behind enemies to perform stealth kills<br></li><li>World Exploration &amp; Survival gameplay<br></li><li>Craft tools and weapons to survive in the jungle <br></li><li>Patch yourself up with makeshift bandages<br></li><li>Adjustable FOV</li></ul><br><strong>Story : </strong><br><br>Garry Friedman, a veteran bush pilot in his early 40’s , still broken down emotionally after a tragic accident involving his wife and his little girl, drowns himself in alcohol every night to escape his torment. Now numb to the constant dangers he faces, Garry keeps signing up for impossible jobs; he gets the cash, doesn’t ask questions, business as usual. Some doubt his motives but Garry needs this danger now, he needs the adrenaline, it’s the closest he gets to feeling alive again. <br><br>On Friday, June 13, 2014, a transport job has him going to a research facility in Yellowstone and bringing the some cargo to Nevada; the drop coordinates would then be updated during the mission. But Garry would never reach his destination… <br><br>0700 hours, slight ground vibrations, not strong enough for anyone to notice. <br>0735 hours, Garry has loaded the cargo and is flying off <br>0740 hours, The Yellowstone super volcano starts erupting <br><br>The sudden gushes of poisonous fumes send Garry and his plane spiraling through the skies. While he tries to regain control, the artifacts inside his cargo start to activate. A sudden burst of energy explodes and suddenly Garry`s plane, and everything with it, crashes into the Amazonian jungle; the drop slowed down by the enormous flora.<br><br>0750 hours, Garry blacks out. The carcass of his plane lies amongst the trees. <br><br>Wild Games Studio presents: <br><br>An extraordinary adventure awaits, where you will need to survive through hostile environments, explore ancient civilizations, and discover a truth that will change your understanding of the world, forever! <br><br>This cargo might have saved your life once, but what happens next? <br><br>It’s all up to you …Day One",
    "about_the_game": "<img src=\"http://cdn.steamstatic.com.8686c.com/steam/apps/242800/extras/ConcoursSurvivalSteam3 copie.jpg?t=1447358089\"><br><br>New Free DLC<br><br>SURVIVAL - CRAFTING - ADVENTURE<br><br>Explore a vast hostile environment while crafting new tools to help you survive. Discover intriguing puzzles and the mystery behind the strange remains of artifacts left in the Amazon Jungle.<br><strong><br>Key Features : </strong><br><br><ul class=\"bb_ul\"><li>Start with nothing and craft, hunt, fish and fight to survive. <br></li><li>Hunt panthers for their meat <br></li><li>Catch fish and find fruits <br></li><li>Build fire and cook your food <br></li><li>Search for water sources <br></li><li>Sneak behind enemies to perform stealth kills<br></li><li>World Exploration &amp; Survival gameplay<br></li><li>Craft tools and weapons to survive in the jungle <br></li><li>Patch yourself up with makeshift bandages<br></li><li>Adjustable FOV</li></ul><br><strong>Story : </strong><br><br>Garry Friedman, a veteran bush pilot in his early 40’s , still broken down emotionally after a tragic accident involving his wife and his little girl, drowns himself in alcohol every night to escape his torment. Now numb to the constant dangers he faces, Garry keeps signing up for impossible jobs; he gets the cash, doesn’t ask questions, business as usual. Some doubt his motives but Garry needs this danger now, he needs the adrenaline, it’s the closest he gets to feeling alive again. <br><br>On Friday, June 13, 2014, a transport job has him going to a research facility in Yellowstone and bringing the some cargo to Nevada; the drop coordinates would then be updated during the mission. But Garry would never reach his destination… <br><br>0700 hours, slight ground vibrations, not strong enough for anyone to notice. <br>0735 hours, Garry has loaded the cargo and is flying off <br>0740 hours, The Yellowstone super volcano starts erupting <br><br>The sudden gushes of poisonous fumes send Garry and his plane spiraling through the skies. While he tries to regain control, the artifacts inside his cargo start to activate. A sudden burst of energy explodes and suddenly Garry`s plane, and everything with it, crashes into the Amazonian jungle; the drop slowed down by the enormous flora.<br><br>0750 hours, Garry blacks out. The carcass of his plane lies amongst the trees. <br><br>Wild Games Studio presents: <br><br>An extraordinary adventure awaits, where you will need to survive through hostile environments, explore ancient civilizations, and discover a truth that will change your understanding of the world, forever! <br><br>This cargo might have saved your life once, but what happens next? <br><br>It’s all up to you …Day One",
